__NUXT_JSONP__("/api/internals-module-container", {data:[{},{path:"\u002Fzh\u002Fapi\u002Finternals-module-container",section:"api",page:{attrs:{title:"API: The ModuleContainer Class",description:"Nuxt ModuleContainer Class"},body:"\u003Ch1 id=\"modulecontainer-class\"\u003E\u003Ca class=\"anchor\" aria-hidden=\"true\" href=\"#modulecontainer-class\"\u003E\u003Csvg version=\"1.1\" width=\"16\" height=\"16\" viewBox=\"0 0 16 16\" class=\"octicon octicon-link\" aria-hidden=\"true\"\u003E\u003Cpath fill-rule=\"evenodd\" d=\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\"\u002F\u003E\u003C\u002Fsvg\u003E\u003C\u002Fa\u003EModuleContainer Class\u003C\u002Fh1\u003E\u003Cul\u003E\n\u003Cli\u003E来源: \u003Cstrong\u003E\u003Ca href=\"https:\u002F\u002Fgithub.com\u002Fnuxt\u002Fnuxt.js\u002Fblob\u002Fdev\u002Fpackages\u002Fcore\u002Fsrc\u002Fmodule.js\"\u003Ecore\u002Fmodule.js\u003C\u002Fa\u003E\u003C\u002Fstrong\u003E\u003C\u002Fli\u003E\n\u003C\u002Ful\u003E\n\u003Cp\u003E所有\u003Ca href=\"\u002Fguide\u002Fmodules\"\u003E模块\u003C\u002Fa\u003E都将在\u003Ccode\u003EModuleContainer\u003C\u002Fcode\u003E实例的\u003Ccode\u003Econtext\u003C\u002Fcode\u003E调用。\u003C\u002Fp\u003E\n\u003Ch2 id=\"tapable-plugins\"\u003E\u003Ca class=\"anchor\" aria-hidden=\"true\" href=\"#tapable-plugins\"\u003E\u003Csvg version=\"1.1\" width=\"16\" height=\"16\" viewBox=\"0 0 16 16\" class=\"octicon octicon-link\" aria-hidden=\"true\"\u003E\u003Cpath fill-rule=\"evenodd\" d=\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\"\u002F\u003E\u003C\u002Fsvg\u003E\u003C\u002Fa\u003ETapable plugins\u003C\u002Fh2\u003E\u003Cp\u003E我们可以在某些生命周期事件中注册hooks。\u003C\u002Fp\u003E\n\u003Cpre\u003E\u003Ccode class=\"hljs js\"\u003Enuxt.moduleContainer.plugin(\u003Cspan class=\"hljs-string\"\u003E&#x27;ready&#x27;\u003C\u002Fspan\u003E, \u003Cspan class=\"hljs-keyword\"\u003Easync\u003C\u002Fspan\u003E (moduleContainer) =&gt; {\n  \u003Cspan class=\"hljs-comment\"\u003E\u002F\u002F Do this after all modules where ready\u003C\u002Fspan\u003E\n})\u003C\u002Fcode\u003E\u003C\u002Fpre\u003E\u003Cp\u003E在 \u003Ca href=\"\u002Fguide\u002Fmodules\"\u003Emodules\u003C\u002Fa\u003E 的\u003Ccode\u003Econtext\u003C\u002Fcode\u003E中我们可以使用它:\u003C\u002Fp\u003E\n\u003Cpre\u003E\u003Ccode class=\"hljs js\"\u003E\u003Cspan class=\"hljs-built_in\"\u003Ethis\u003C\u002Fspan\u003E.plugin(\u003Cspan class=\"hljs-string\"\u003E&#x27;ready&#x27;\u003C\u002Fspan\u003E, \u003Cspan class=\"hljs-keyword\"\u003Easync\u003C\u002Fspan\u003E (moduleContainer) =&gt; {\n  \u003Cspan class=\"hljs-comment\"\u003E\u002F\u002F Do this after all modules where ready\u003C\u002Fspan\u003E\n})\u003C\u002Fcode\u003E\u003C\u002Fpre\u003E\u003Ctable\u003E\n\u003Cthead\u003E\n\u003Ctr\u003E\n\u003Cth\u003E插件\u003C\u002Fth\u003E\n\u003Cth\u003E参数\u003C\u002Fth\u003E\n\u003Cth\u003E说明\u003C\u002Fth\u003E\n\u003C\u002Ftr\u003E\n\u003C\u002Fthead\u003E\n\u003Ctbody\u003E\u003Ctr\u003E\n\u003Ctd\u003E\u003Ccode\u003Eready\u003C\u002Fcode\u003E\u003C\u002Ftd\u003E\n\u003Ctd\u003EmoduleContainer\u003C\u002Ftd\u003E\n\u003Ctd\u003E\u003Ccode\u003Enuxt.config.js\u003C\u002Fcode\u003E中的所有模块都已初始化\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003C\u002Ftbody\u003E\u003C\u002Ftable\u003E\n\u003Ch2 id=\"方法\"\u003E\u003Ca class=\"anchor\" aria-hidden=\"true\" href=\"#方法\"\u003E\u003Csvg version=\"1.1\" width=\"16\" height=\"16\" viewBox=\"0 0 16 16\" class=\"octicon octicon-link\" aria-hidden=\"true\"\u003E\u003Cpath fill-rule=\"evenodd\" d=\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\"\u002F\u003E\u003C\u002Fsvg\u003E\u003C\u002Fa\u003E方法\u003C\u002Fh2\u003E\u003Ch3 id=\"-del-添加vendor-vendor-del-\"\u003E\u003Ca class=\"anchor\" aria-hidden=\"true\" href=\"#-del-添加vendor-vendor-del-\"\u003E\u003Csvg version=\"1.1\" width=\"16\" height=\"16\" viewBox=\"0 0 16 16\" class=\"octicon octicon-link\" aria-hidden=\"true\"\u003E\u003Cpath fill-rule=\"evenodd\" d=\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\"\u002F\u003E\u003C\u002Fsvg\u003E\u003C\u002Fa\u003E\u003Cdel\u003E添加Vendor(vendor)\u003C\u002Fdel\u003E\u003C\u002Fh3\u003E\u003Cp\u003E\u003Cstrong\u003E\u003Ccode\u003Evendor\u003C\u002Fcode\u003E已经废弃不再使用\u003C\u002Fstrong\u003E\u003C\u002Fp\u003E\n\u003Cp\u003E添加到\u003Ccode\u003Eoptions.build.vendor\u003C\u002Fcode\u003E并应用唯一插件过滤器。\u003C\u002Fp\u003E\n\u003Ch3 id=\"添加到模板中-template-\"\u003E\u003Ca class=\"anchor\" aria-hidden=\"true\" href=\"#添加到模板中-template-\"\u003E\u003Csvg version=\"1.1\" width=\"16\" height=\"16\" viewBox=\"0 0 16 16\" class=\"octicon octicon-link\" aria-hidden=\"true\"\u003E\u003Cpath fill-rule=\"evenodd\" d=\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\"\u002F\u003E\u003C\u002Fsvg\u003E\u003C\u002Fa\u003E添加到模板中 (template)\u003C\u002Fh3\u003E\u003Cul\u003E\n\u003Cli\u003E\u003Cstrong\u003Etemplate\u003C\u002Fstrong\u003E: \u003Ccode\u003EString\u003C\u002Fcode\u003E or \u003Ccode\u003EObject\u003C\u002Fcode\u003E\u003Cul\u003E\n\u003Cli\u003E\u003Ccode\u003Esrc\u003C\u002Fcode\u003E\u003C\u002Fli\u003E\n\u003Cli\u003E\u003Ccode\u003Eoptions\u003C\u002Fcode\u003E\u003C\u002Fli\u003E\n\u003Cli\u003E\u003Ccode\u003EfileName\u003C\u002Fcode\u003E\u003C\u002Fli\u003E\n\u003C\u002Ful\u003E\n\u003C\u002Fli\u003E\n\u003C\u002Ful\u003E\n\u003Cp\u003E在构建到项目\u003Ccode\u003EbuildDir\u003C\u002Fcode\u003E (\u003Ccode\u003E.nuxt\u003C\u002Fcode\u003E)期间使用\u003Ca href=\"https:\u002F\u002Flodash.com\u002Fdocs\u002F4.17.4#template\"\u003Elodash 模板\u003C\u002Fa\u003E渲染指定模板。\u003C\u002Fp\u003E\n\u003Cp\u003E如果未提供\u003Ccode\u003EfileName\u003C\u002Fcode\u003E或\u003Ccode\u003Etemplate\u003C\u002Fcode\u003E为\u003Ccode\u003Estring\u003C\u002Fcode\u003E，则目标文件名默认为\u003Ccode\u003E[dirName].[fileName].[pathHash].[ext]\u003C\u002Fcode\u003E。\u003C\u002Fp\u003E\n\u003Cp\u003E这个方法将返回 \u003Ccode\u003E{ dist, src, options }\u003C\u002Fcode\u003E 对象.\u003C\u002Fp\u003E\n\u003Ch3 id=\"添加插件-template-\"\u003E\u003Ca class=\"anchor\" aria-hidden=\"true\" href=\"#添加插件-template-\"\u003E\u003Csvg version=\"1.1\" width=\"16\" height=\"16\" viewBox=\"0 0 16 16\" class=\"octicon octicon-link\" aria-hidden=\"true\"\u003E\u003Cpath fill-rule=\"evenodd\" d=\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\"\u002F\u003E\u003C\u002Fsvg\u003E\u003C\u002Fa\u003E添加插件 (template)\u003C\u002Fh3\u003E\u003Cp\u003E使用\u003Ccode\u003EaddTemplate\u003C\u002Fcode\u003E注册插件并将其添加到 \u003Ccode\u003Eplugins[]\u003C\u002Fcode\u003E选项。\u003C\u002Fp\u003E\n\u003Cp\u003E您可以使用\u003Ccode\u003Etemplate.ssr: false\u003C\u002Fcode\u003E来禁用包含在SSR中的插件。\u003C\u002Fp\u003E\n\u003Ch3 id=\"添加服务器端渲染中间件-middleware-\"\u003E\u003Ca class=\"anchor\" aria-hidden=\"true\" href=\"#添加服务器端渲染中间件-middleware-\"\u003E\u003Csvg version=\"1.1\" width=\"16\" height=\"16\" viewBox=\"0 0 16 16\" class=\"octicon octicon-link\" aria-hidden=\"true\"\u003E\u003Cpath fill-rule=\"evenodd\" d=\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\"\u002F\u003E\u003C\u002Fsvg\u003E\u003C\u002Fa\u003E添加服务器端渲染中间件 (middleware)\u003C\u002Fh3\u003E\u003Cp\u003E将中间件插入 \u003Ca href=\"\u002Fapi\u002Fconfiguration-servermiddleware\"\u003Eoptions.serverMiddleware\u003C\u002Fa\u003E.\u003C\u002Fp\u003E\n\u003Ch3 id=\"extendbuild-fn-\"\u003E\u003Ca class=\"anchor\" aria-hidden=\"true\" href=\"#extendbuild-fn-\"\u003E\u003Csvg version=\"1.1\" width=\"16\" height=\"16\" viewBox=\"0 0 16 16\" class=\"octicon octicon-link\" aria-hidden=\"true\"\u003E\u003Cpath fill-rule=\"evenodd\" d=\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\"\u002F\u003E\u003C\u002Fsvg\u003E\u003C\u002Fa\u003EextendBuild (fn)\u003C\u002Fh3\u003E\u003Cp\u003EAllows easily extending webpack build config by chaining \u003Ca href=\"\u002Fapi\u002Fconfiguration-build#extend\"\u003Eoptions.build.extend\u003C\u002Fa\u003E function.\u003C\u002Fp\u003E\n\u003Ch3 id=\"extendroutes-fn-\"\u003E\u003Ca class=\"anchor\" aria-hidden=\"true\" href=\"#extendroutes-fn-\"\u003E\u003Csvg version=\"1.1\" width=\"16\" height=\"16\" viewBox=\"0 0 16 16\" class=\"octicon octicon-link\" aria-hidden=\"true\"\u003E\u003Cpath fill-rule=\"evenodd\" d=\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\"\u002F\u003E\u003C\u002Fsvg\u003E\u003C\u002Fa\u003EextendRoutes (fn)\u003C\u002Fh3\u003E\u003Cp\u003E允许通过链接\u003Ca href=\"\u002Fapi\u002Fconfiguration-router#extendroutes\"\u003Eoptions.build.extendRoutes\u003C\u002Fa\u003E函数轻松扩展webpack构建配置。\u003C\u002Fp\u003E\n\u003Ch3 id=\"添加模块-moduleopts-requireonce-\"\u003E\u003Ca class=\"anchor\" aria-hidden=\"true\" href=\"#添加模块-moduleopts-requireonce-\"\u003E\u003Csvg version=\"1.1\" width=\"16\" height=\"16\" viewBox=\"0 0 16 16\" class=\"octicon octicon-link\" aria-hidden=\"true\"\u003E\u003Cpath fill-rule=\"evenodd\" d=\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\"\u002F\u003E\u003C\u002Fsvg\u003E\u003C\u002Fa\u003E添加模块 (moduleOpts, requireOnce)\u003C\u002Fh3\u003E\u003Cp\u003E注册模块。\u003Ccode\u003EmoduleOpts\u003C\u002Fcode\u003E可以是\u003Ccode\u003Estring\u003C\u002Fcode\u003E或\u003Ccode\u003E[src, options]\u003C\u002Fcode\u003E。如果\u003Ccode\u003ErequireOnce\u003C\u002Fcode\u003E为\u003Ccode\u003Etrue\u003C\u002Fcode\u003E且已解析的模块导出\u003Ccode\u003Emeta\u003C\u002Fcode\u003E阻止两次注册相同的模块。\u003C\u002Fp\u003E\n\u003Ch3 id=\"requiremodule-moduleopts-\"\u003E\u003Ca class=\"anchor\" aria-hidden=\"true\" href=\"#requiremodule-moduleopts-\"\u003E\u003Csvg version=\"1.1\" width=\"16\" height=\"16\" viewBox=\"0 0 16 16\" class=\"octicon octicon-link\" aria-hidden=\"true\"\u003E\u003Cpath fill-rule=\"evenodd\" d=\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\"\u002F\u003E\u003C\u002Fsvg\u003E\u003C\u002Fa\u003ErequireModule (moduleOpts)\u003C\u002Fh3\u003E\u003Cp\u003E\u003Ccode\u003EaddModule(moduleOpts, true)\u003C\u002Fcode\u003E\u003C\u002Fp\u003E\n\u003Ch2 id=\"hooks\"\u003E\u003Ca class=\"anchor\" aria-hidden=\"true\" href=\"#hooks\"\u003E\u003Csvg version=\"1.1\" width=\"16\" height=\"16\" viewBox=\"0 0 16 16\" class=\"octicon octicon-link\" aria-hidden=\"true\"\u003E\u003Cpath fill-rule=\"evenodd\" d=\"M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z\"\u002F\u003E\u003C\u002Fsvg\u003E\u003C\u002Fa\u003EHooks\u003C\u002Fh2\u003E\u003Cp\u003E我们可以在某些生命周期事件中注册钩子。\u003C\u002Fp\u003E\n\u003Ctable\u003E\n\u003Cthead\u003E\n\u003Ctr\u003E\n\u003Cth\u003EHook\u003C\u002Fth\u003E\n\u003Cth\u003EArguments\u003C\u002Fth\u003E\n\u003Cth\u003EWhen\u003C\u002Fth\u003E\n\u003C\u002Ftr\u003E\n\u003C\u002Fthead\u003E\n\u003Ctbody\u003E\u003Ctr\u003E\n\u003Ctd\u003E\u003Ccode\u003Emodules:before\u003C\u002Fcode\u003E\u003C\u002Ftd\u003E\n\u003Ctd\u003E(moduleContainer, options)\u003C\u002Ftd\u003E\n\u003Ctd\u003E在创建ModuleContainer类之前调用​​，对重载方法和选项很有用。\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003Ctr\u003E\n\u003Ctd\u003E\u003Ccode\u003Emodules:done\u003C\u002Fcode\u003E\u003C\u002Ftd\u003E\n\u003Ctd\u003E(moduleContainer)\u003C\u002Ftd\u003E\n\u003Ctd\u003E加载所有模块时调用。\u003C\u002Ftd\u003E\n\u003C\u002Ftr\u003E\n\u003C\u002Ftbody\u003E\u003C\u002Ftable\u003E\n"},contributors:[{author:"warriorBrian"},{author:"manniL"}]}],fetch:[],mutations:[]});